//Gallery
let galleryImages = document.querySelectorAll(".gallery-img");
let getLatestOpenedImg;
let windowWidth = window.innerWidth;

if (galleryImages) {
    galleryImages.forEach(function (image, index) {
        image.onclick = function () {
            let getElementCss = window.getComputedStyle(image);
            let getFullImgUrl = getElementCss.getPropertyValue("background-image");
            let getImgUrlPos = getFullImgUrl.split("/assets/images/");
            let setNewImgUrl = getImgUrlPos[1].replace('")', '');

            getLatestOpenedImg = index + 1;
            let container = document.body;
            let newImgWindow = document.createElement("div");
            container.appendChild(newImgWindow);
            newImgWindow.setAttribute("class", "img-window");
            newImgWindow.setAttribute("onclick", "closeImg()");

            let newImg = document.createElement("img");
            newImgWindow.appendChild(newImg);
            newImg.setAttribute("src", "assets/images/" + setNewImgUrl);
            newImg.setAttribute("id", "current-img");

            newImg.onload = function () {

                let imgWidth = this.width;
                let calcImgToEdge = ((windowWidth - imgWidth) / 2) - 10;

                let newNextBtn = document.createElement("a");
                let btnNextText = document.createTextNode(">");
                newNextBtn.appendChild(btnNextText);
                container.appendChild(newNextBtn);
                newNextBtn.setAttribute("class", "img-btn-next");
                newNextBtn.setAttribute("onclick", "changeImg(1)");
                newNextBtn.style.cssText = "right: " + calcImgToEdge + "px;";

                let newPrevBtn = document.createElement("a");
                let btnPrevText = document.createTextNode("<");
                newPrevBtn.appendChild(btnPrevText);
                container.appendChild(newPrevBtn);
                newPrevBtn.setAttribute("class", "img-btn-prev");
                newPrevBtn.setAttribute("onclick", "changeImg(0)");
                newPrevBtn.style.cssText = "left: " + calcImgToEdge + "px;";
            }
        }
    }
    )
}

function closeImg() {
    document.querySelector(".img-window").remove();
    document.querySelector(".img-btn-next").remove();
    document.querySelector(".img-btn-prev").remove();
}

function changeImg(changeDir) {
    document.querySelector("#current-img").remove();

    let getImgWindow = document.querySelector(".img-window")
    let newImg = document.createElement("img");
    getImgWindow.appendChild(newImg);

    let calcNewImg;

    if (changeDir === 1) {
        calcNewImg = getLatestOpenedImg + 1;

        if (calcNewImg > galleryImages.length) {
            calcNewImg = 1;
        }
    }

    else if (changeDir === 0) {
        calcNewImg = getLatestOpenedImg - 1;

        if (calcNewImg < 1) {
            calcNewImg = galleryImages.length;
        }
    }

    newImg.setAttribute("src", "assets/images/img" + calcNewImg + ".jpg");
    newImg.setAttribute("id", "current-img");
    getLatestOpenedImg = calcNewImg;

    newImg.onload = function () {
        let imgWidth = this.width;
        let calcImgToEdge = ((windowWidth - imgWidth) / 2) - 10;


        let nextBtn = document.querySelector(".img-btn-next");
        nextBtn.style.cssText = "right: " + calcImgToEdge + "px;";

        let prevBtn = document.querySelector(".img-btn-prev");
        prevBtn.style.cssText = "left: " + calcImgToEdge + "px;";
    }
}

//Contact Form
window.addEventListener("DOMContentLoaded", function () {
    // get the form elements defined in your form HTML above
    var form = document.getElementById("frmHome");
    var button = document.getElementById("btnContact");
    var status = document.getElementById("form-status");
    // Success and Error functions for after the form is submitted
    function success() {
        form.reset();
        button.style = "display: none ";
        status.innerHTML = "Thanks!";
    }
    function error() {
        status.innerHTML = "Oops! There was a problem.";
    }
    // handle the form submission event
    form.addEventListener("submit", function (ev) {
        ev.preventDefault();
        var data = new FormData(form);
        ajax(form.method, form.action, data, success, error);
    });
});
//helper function for sending an AJAX request
function ajax(method, url, data, success, error) {
    var xhr = new XMLHttpRequest();
    xhr.open(method, url);
    xhr.setRequestHeader("Accept", "application/json");
    xhr.onreadystatechange = function () {
        if (xhr.readyState !== XMLHttpRequest.DONE) return;
        if (xhr.status === 200) {
            success(xhr.response, xhr.responseType);
        } else {
            error(xhr.status, xhr.response, xhr.responseType);
        }
    };
    xhr.send(data);
}

//Calculate Invoice Total 
$(".input").on('input', function () {
    var q = document.getElementById('quantity').value;

    var p = document.getElementById('inputPrice').value;

    var t = document.getElementById('transfee').value;

    var total = parseFloat(p) * parseFloat(q) + parseFloat(t);

    if (Number.isNaN(q))
        q = 0;

    if (Number.isNaN(p))
        p = 0;

    if (Number.isNaN(t))
        t = 0;

    if (Number.isNaN(total))
        total = 0;

    document.getElementById('total').innerHTML = "R" + (Math.round(total * 100) / 100).toFixed(2);
});

//Calculate Custom Invoice Total 
$(".inputC").on('input', function () {
    var q = document.getElementById('quantity').value;

    var p = document.getElementById('inputPrice').value;

    var t = document.getElementById('transfee').value;

    var c = document.getElementById('inputCurrency').value;

    var total = parseFloat(p) * parseFloat(q) + parseFloat(t);

    if (Number.isNaN(q))
        q = 0;

    if (Number.isNaN(p))
        p = 0;

    if (Number.isNaN(t))
        t = 0;

    if (Number.isNaN(total))
        total = 0;

    document.getElementById('total').innerHTML = c + (Math.round(total * 100) / 100).toFixed(2);
});

//PDF Invoice Document
$('#button').click(function () {

    var doc = new jsPDF();

    var imgData = 'data:image/jpeg;base64,';

    doc.addImage(imgData, 'JPEG', 0, 0, 210, 297);

    var name = $('#name').val();
    var surname = $('#surname').val();
    var number = $('#number').val();
    var email = $('#email').val();
    var description = $('#inputDescription').val();
    var quantity = $('#quantity').val();
    var priceNumber = $('#inputPrice').val();
    var transfeeNumber = $('#transfee').val();

    var e_mail = 'info@eoifilms.co.za';

    var link = 'www.eoifilms.co.za';

    var today = new Date();

    var date = today.getFullYear() + '-' + (today.getMonth() + 1) + '-' + today.getDate();

    var q = document.getElementById('quantity').value;

    var p = document.getElementById('inputPrice').value;

    var t = document.getElementById('transfee').value;

    var subTotal = parseFloat(p) * parseFloat(q) + parseFloat(t);

    if (Number.isNaN(q))
        q = 0;

    if (Number.isNaN(p))
        p = 0;

    if (Number.isNaN(t))
        t = 0;

    if (Number.isNaN(subTotal))
        subTotal = 0;

    var price = "R" + (Math.round(priceNumber * 100) / 100).toFixed(2);
    var transfee = "R" + (Math.round(transfeeNumber * 100) / 100).toFixed(2);
    var finaltotal = "R" + (Math.round(subTotal * 100) / 100).toFixed(2);

    doc.setFontSize(20);
    doc.setTextColor(0, 0, 0);

    doc.text(46, 65.5, e_mail);
    doc.text(39.5, 97.5, date);
    doc.text(43, 111.5, name);
    doc.text(54, 125.5, surname);
    doc.text(51, 139.5, number);
    doc.text(44.5, 153.5, email);
    doc.text(63, 168, description);
    doc.text(53, 182, quantity);
    doc.text(40, 196, price);
    doc.text(90, 210, transfee);
    doc.text(40.5, 224, finaltotal);
    doc.text(73, 280, link);

    doc.save('invoice.pdf');

});

